import React, { useState } from "react";
import ReactDOM from "react-dom";
import Button from '@mui/material/Button';
import "./FutuTable.css"
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { makeStyles } from "@mui/styles" ;
let data = require("./data/Futu_final_output.json");


const useStyles = makeStyles((theme) => ({
    tableContainer: {
      borderRadius: 15,
      margin: "10px 10px",
      maxWidth: 950
    }
}))

function FutuTable () {
  const classes = useStyles();

  return (
      <div className="table-container">
        <h1>Hi this is supposed to be a table</h1>
        <TableContainer component={Paper} className={classes.tableContainer}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell  align="right">Number of posts</TableCell>
            <TableCell  align="right">Total Engagement rate</TableCell>
            <TableCell  align="right">Market Attitude</TableCell>
            <TableCell  align="right">Overall Score</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.posts_sum}</TableCell>
              <TableCell align="right">{row.total_engagement_rate}</TableCell>
              <TableCell align="right">{row.market_attitude}</TableCell>
              <TableCell align="right">{row.overall_score}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>







        {/* <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Number of Posts</th>
              <th>Total Engagement rate</th>
              <th>Market attitude score</th>
              <th>Overall score</th>

            </tr>
          </thead>
          <tbody>
          {stocks.map((stocks)=> (
            <tr>
              <td>{stocks.name}</td>
              <td>{stocks.posts_sum}</td>
              <td>{stocks.total_engagement_rate}</td>
              <td>{stocks.market_attitude}</td>
              <td>{stocks.overall_score}</td>

            </tr>
          ))}

          </tbody>
        </table> */}

      </div>
  );
}

export default FutuTable ;
